import CodeTDetail from "./CodeTDetail";
import projectTags from "../ProjectTags";
import cover from "./cover.png";

const CodeT = {
  name: "Code-T",
  description: "A multiplayer shooter game built by Unreal Engine 4.",
  cover: cover,
  tags: [projectTags.game, projectTags.unreal],
  detail: CodeTDetail,
};

export default CodeT;
